import React from 'react';
import MenuHeader from "../components/auth/MenuHeader";
import LoginForm from "../components/auth/LoginForm";

const Login = () => {
    return (
        <div>
            <MenuHeader />
            <LoginForm />
        </div>
    );
};

export default Login;
